import React, { useState, useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import '../../assets/css/dashboard.css';
import WelcomeCard from '../../components/dashboard/WelcomeCard';
import SummaryCards from '../../components/dashboard/SummaryCards';
import Charts from '../../components/dashboard/Charts';
import QuickActions from '../../components/dashboard/QuickActions';
import AllFeatures from '../../components/dashboard/AllFeatures';
import QuickActionModal from '../../components/dashboard/QuickActionModal';

const DashboardPage: React.FC = () => {
    const [isModalOpen, setModalOpen] = useState(false);

    useEffect(() => {
        AOS.init();
    }, []);

    const refreshDashboard = () => {
        // showInfo('Dashboard yenileniyor...');
        setTimeout(() => {
            location.reload();
        }, 1000);
    };

    return (
        <div className="app-content" style={{ background: '#f6f8fb', minHeight: '100vh', padding: '32px' }}>
            <div className="container-fluid">
                <div className="dashboard-layout">
                    <div className="main-content">
                        {/* Üst Satır: Başlık */}
                        <div className="d-flex justify-content-between align-items-center mb-4">
                            <div>
                                <h1 className="h3 mb-0 text-gradient">Dashboard</h1>
                                <p className="text-muted mb-0">Hoş geldin! Finansal durumuna göz at.</p>
                            </div>
                        </div>

                        {/* Hoş Geldin Kartı */}
                        <WelcomeCard />

                        {/* Banner */}
                        <div className="d-flex align-items-center justify-content-between mb-4" style={{ background: '#23243a', color: '#fff', borderRadius: '14px', padding: '24px 32px' }}>
                            <div style={{ fontWeight: 600, fontSize: 20 }}>Xtreme AI Hazır! Hemen Dene... Yapay Zekaya Danış →</div>
                            <form className="d-flex align-items-center" style={{ gap: 8 }}>
                                <input type="email" placeholder="E-posta adresin" className="form-control" style={{ minWidth: 200, borderRadius: 8, border: 'none', padding: '8px 12px' }} />
                                <button className="btn btn-primary" type="submit">Abone Ol</button>
                            </form>
                        </div>

                        {/* Özet Kartlar */}
                        <SummaryCards />

                        <div className="row">
                            <div className="col-lg-6 mb-4">
                                <Charts />
                            </div>
                            <div className="col-lg-6 mb-4">
                                {/* Son İşlemler buraya gelecek */}
                                <div className="modern-card h-100">
                                    <div className="card-body">
                                        <h5 className="card-title">Son İşlemler</h5>
                                        {/* İçerik */}
                                    </div>
                                </div>
                            </div>
                        </div>
                        
                        <QuickActions />

                        <AllFeatures />
                    </div>
                    <div className="right-sidebar">
                        {/* Hava Durumu Kartı */}
                        <div className="modern-card mb-4">
                             <div style={{background: '#6c3483', color: '#fff', borderRadius: '12px', padding: '12px 24px', minWidth: 160, display: 'flex', flexDirection: 'column', alignItems: 'flex-end'}}>
                                <div style={{fontWeight: 600}}>Tarragona</div>
                                <div style={{fontSize: 28, fontWeight: 700}}>32° <span style={{fontSize: 18, fontWeight: 400}}>☀️</span></div>
                                <div style={{fontSize: 12}}>Bulutlu</div>
                            </div>
                        </div>
                        
                        {/* Mevcut Kasa Kartı */}
                        <div className="modern-card">
                            <div style={{ background: '#23243a', color: '#fff', borderRadius: '18px', padding: '32px', minWidth: 260, display: 'flex', flexDirection: 'column', justifyContent: 'space-between' }}>
                                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                                    <div>
                                        <div style={{ fontSize: 14, opacity: 0.8 }}>MEVCUT KASA</div>
                                        <div style={{ fontSize: 13, margin: '2px 0 8px 0' }}><span style={{ fontWeight: 600 }}>09:20AM</span> <span style={{ opacity: 0.7 }}>04 Ocak</span></div>
                                    </div>
                                    <div style={{ color: '#2ecc71', fontWeight: 600, fontSize: 16 }}>▲ 2.89%</div>
                                </div>
                                <div style={{ fontSize: 32, fontWeight: 700, margin: '16px 0' }}>₺1,567</div>
                                <div style={{ height: 8, background: '#444', borderRadius: 4, marginBottom: 8 }}>
                                    <div style={{ width: '80%', height: '100%', background: 'linear-gradient(90deg, #667eea 0%, #764ba2 100%)', borderRadius: 4 }}></div>
                                </div>
                                <div className="d-flex justify-content-between" style={{ fontSize: 13 }}>
                                    <span>0%</span>
                                    <span>8%</span>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <QuickActionModal isOpen={isModalOpen} onClose={() => setModalOpen(false)} />
            </div>
        </div>
    );
};

export default DashboardPage;
